import React from "react";
import SubjectsCard from "./SubjectsCard";

const SubjectsList = ({ subjectsData }) => {
  function funct(subjectsData) {
    if (subjectsData.length === 1) return [subjectsData];
    else return subjectsData;
  }

  console.log(subjectsData);
  return [subjectsData].length > 0 ? (
    funct(subjectsData).map((subject, index) => {
      return (
        <SubjectsCard
          key={index}
          id={subject.subjectId}
          subjectName={subject.subjectName}
          mark={subject.mark}
        />
      );
    })
  ) : (
    <h1>No data retreived</h1>
  );
};

export default SubjectsList;
